import {React,useState} from "react";
import { Link, Route, Switch } from "react-router-dom";


const App = () => {

    const [posts, setPosts] = useState([])
    const [token, setToken] = useState('')

    return <main>
        <h1>Strangers Things</h1>
        <Link to="/home">Home</Link> |
        <Link to="/posts">Posts</Link> |
        <Link to="/profile">Profile</Link> |
        <Link to="/logout">Log Out</Link> |

        <Switch>
            <Route exact path="/home"><h1>Welcome to Stranger Things </h1></Route>
            <Route exact path="/profile"><div>Profile</div></Route>
            <Route path="/posts"><div>posts</div></Route>
            <Route path="/login"><div>login</div></Route>
            <Route path= "/register"><div>register</div></Route>
            <Route path= "/logout"><div>logout</div></Route>
        </Switch>



    </main>
}

export default App;
